import logo from '../images/sign-up-logo.png'

const Login = () => {
    return ( 
        <div className="login-container">
            <div className="left">
                <div className="sign-up-logo-container">
                    <img src={logo} alt="" />
                </div>
                <h1> Welcome back </h1>
                <h4>Log in to your account</h4>

            </div>
            <div className="right">

            </div>


        </div>
     );
}

export default Login;
